import { useState } from "react";

function Condition() {
    function sendEmail(e) {
        e.preventDefault()
        console.log('Testando Email')
    }
    return(
    <div>
        <h2> Insert Email: </h2>
        <form>
            <input type="email" placeholder= "Insert your e-mail..."/>
            <button type="submit" onClick={sendEmail}>
                Send Email
            </button>
        </form>
    </div>
    )
}

export default Condition
